            L2_RECEPIENT,
            msg.value - (gasLimitCost + chargedFees),
            swapAndProveLiqudityData,
            GAS_LIMIT,
            msg.sender
        );
        if (IPointsDistributor(rewardsContract).isPointDistributionActive()) {
            IPointsDistributor(rewardsContract).distributePoints(msg.value);
